export default {
  all() {
    return users;
  },
  save(user) {
    users.push(user);
    return user;
  },
  show(email) {
    return users.find(user => user.email === email);
  },
  update(user) {
    const index = users.findIndex(({ email }) => user.email === email);
    users[index] = user;

    return user;
  }
};
